import { useGlobalContext } from "./context";

const Stories = () => {
  const { hits, nbPages, isLoading } = useGlobalContext();

  if (isLoading) {
    return (
      <>
        <h1>Loading...</h1>
      </>
    );
  }

  return (
    <>
      <h1>My Tech News Website</h1>
      {/* {hits.map((curPost) => {
        return (
          <>
            <h2>{curPost.title}</h2>
            <p>{nbPages}</p>
          </>
        );
      })} */}
    </>
  );
};

export default Stories;
